import React from 'react'
import axios from "axios";
import {Formik, Form, Field, ErrorMessage} from "formik";
import * as Yup from "yup";


function Register() {
    const initialValues = {
        email: "",
        password: "",
    };

    const onSubmit = (data) => {
        axios.post("http://localhost:3001/authentication", data).then(() => {
            console.log(data);
        });
    };

    const validationSchema = Yup.object().shape({
        email: Yup.string().required(),
        password: Yup.string().min(8).max(25).required()
    });

  return (
    
    <div className="addIngredientPage">
      <Formik initialValues={initialValues} onSubmit={onSubmit} validationSchema={validationSchema}>
        <Form className='formContainer'>
            <label>E-mail: </label>
            <ErrorMessage name="email" component="span"/>
            <Field autoComplete="off" id="inputRegister" name="email" placeholder="Example: mail@mail.com" />

            <label>Password: </label>
            <ErrorMessage name="password" component="span"/>
            <Field autoComplete="off" id="inputRegister" name="password" placeholder="Example: pass1234" />

            <button type="submit">Register</button>
        </Form>
       </Formik>
    </div>
  )
}

export default Register
